when a taco, a salad, and a veggie burger walk into a bowl, you get a VEGGIE BURGER TACO SALAD 🌮🤩🙌🏻 this one’s been a weeknight staple for me the past few weeks — just wholesome plant-based ingredients that come together quickly and get doused in a **creamy tahini avocado dressing** so good you’ll wanna lick the bowl. 

@drpraegers california veggie burgers are packed with real vegetables (10 of them!) big flavor, and have a unique blend of spices to satisfy any craving. they’ve been a favorite freezer staple of mine since high school and continue to be my go-to because they taste as good as they make me feel. 🌱🥰 you can now find these burgers at Whole Foods nationwide!

VEGGIE BURGER TACO SALADS w/ CREAMY TAHINI AVOCADO RANCH (serves 2)
for the creamy tahini avocado ranch dressing 🥑🥛:
1/4 cup freshly-squeezed lemon juice • 1/4 cup tahini • 1/2 ripe avocado • 3 tablespoons warm water • 2 tablespoons chopped fresh dill • 1 tablespoon chopped fresh chives (optional) • 1 teaspoon dijon mustard • 1/2 teaspoon onion powder • 1/2 teaspoon garlic powder • fine sea salt and freshly-cracked black pepper

for the salad 🥗 : 2 cups chopped romaine lettuce + 2 cups chopped spinach • 2 @drpraegers california veggie burgers, crisped in the air fryer for 8-10 minutes at 390F. • 1 avocado, halved and sliced • 1/2 cup cherry tomatoes, sliced • 1/4 cup cotija or feta cheese • 1/4 cup cilantro, chopped • 1/2 cup favorite corn chips
